async ({ url }, { h1 }) => {
    const browser = await puppeteer.launch();
    const page = await browser.newPage();
    await page.goto(url);
    const h1Element = await page.$("h1");
    if (h1Element) {
      const h1Text = await page.evaluate((element) => element.textContent, h1Element);
      h1.next(h1Text);
    }
    await browser.close();
  }
